// SPDX-License-Identifier:MIT
pragma solidity 0.6.9;

import "./Token_v1.sol";
import "./Roles/Wiper.sol";
import "./Util/EIP712.sol";
import "./MetaTransactions.sol";
import "./Permit.sol";
import "./Testmint.sol";
import "@opengsn/gsn/contracts/BaseRelayRecipient.sol";

contract Token_v2 is Token_v1, Wiper, BaseRelayRecipient, MetaTransactions, Permit, Testmint  {

    bool private _initializedV2;

    event ProhibitedAddressWiped(address indexed addr, uint256 amount);

    // initialize V2
    function initializeV2(string calldata _newName, address _wiper, address _forwarder) external {
        require(
            !_initializedV2,
            "Contract is already initialized"
        );
        //new name
        name = _newName;

        //initialize wiper
        wiper = _wiper;

        DOMAIN_SEPARATOR = EIP712.makeDomainSeparator(name, "2");

        trustedForwarder = _forwarder;        
        _initializedV2 = true;

    }

    // wipe balance of prohibited address
    function wipeProhibitedAddress(address _account) public whenNotPaused onlyWiper onlyProhibited(_account) {
        uint256 _balance = balanceOf(_account);
        _burn(_account, _balance);
        emit ProhibitedAddressWiped(_account, _balance);
    }

    function transfer(address _recipient, uint256 _amount) public override whenNotPaused onlyNotProhibited(msg.sender) isNaturalNumber(_amount) returns (bool) {
        //_transfer(msg.sender, _recipient, _amount);
        _transfer(_msgSender(), _recipient, _amount);
        return true;
    }

    function versionRecipient() external override view returns (string memory) {
        return "2.0.0";
    }

    // not need
    function SetTrustedForwarder(address forwarder) public whenNotPaused onlyAdmin {
        trustedForwarder = forwarder;
    }
}
